import React from 'react';

export default function SVGFog({ className }) {
  return (
    <svg
      className={className}
      width="1000"
      height="1000"
      viewBox="0 0 1000 1000"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      style={{ filter: 'blur(96px)' }}
    >
      {/* Even larger ellipses for maximum spread */}
      <ellipse cx="0" cy="1000" rx="1000" ry="1000" fill="#fff" fillOpacity="0.18" />
      <ellipse cx="200" cy="1000" rx="1000" ry="1000" fill="#fff" fillOpacity="0.10" />
      <ellipse cx="400" cy="1000" rx="1000" ry="1000" fill="#fff" fillOpacity="0.07" />
    </svg>
  );
}
